  const calculateBaseExperience = () => {
    var totalPlayer=0;
    var totalPlayer1=0;
    save.map((index) => {
        totalPlayer = index.quantity * index.pokemon.experience;
        totalPlayer1=totalPlayer+totalPlayer1
        console.log(totalPlayer1);
        return totalPlayer1;
    });

  };

  return (
    <div className="ResultGlobalContent">
      <div className="ResultTextButton">
        <div className="ResultTextContent">troca boa ein</div>
        <div className="ResultButtonJogar">
          <Link style={{ textDecoration: "none" }} to={{ pathname: "/" }}>
            <button className="ButtonResult">Jogar novamente</button>
          </Link>
        </div>
      </div>
      <div className="ResultImg">
        <img alt="Charizard pokemon" src={Charizard} onClick={calculateBaseExperience}/>
      </div>
    </div>
  );
}

export default ResultPage;
